import React from 'react'
import { Card, CardCategory, FlexWrapper, StyledCard } from './Styled'
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";


function Cards() {
  return (
    <FlexWrapper>
      <Swiper
        slidesPerView={1}
        spaceBetween={30}
        loop={true}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Pagination, Navigation, Autoplay]}
      >
        <SwiperSlide>
          <StyledCard>
            <CardCategory>POP</CardCategory>
          </StyledCard>
        </SwiperSlide>
        <SwiperSlide>
          <Card>
            <CardCategory>INDIE</CardCategory>
          </Card>
        </SwiperSlide>
        <SwiperSlide>
          <StyledCard>
            <CardCategory>RAP</CardCategory>
          </StyledCard>
        </SwiperSlide>
        <SwiperSlide>
          <Card>
            <CardCategory>RETRO</CardCategory>
          </Card>
        </SwiperSlide>
      </Swiper>
    </FlexWrapper>
  );
}

export default Cards
